import React from 'react';

const aStyle = {
  color: 'black',
  textDecoration: 'none',
  fontSize: '2rem',
}

function MainLink(linkText, href) {
  return (
    <>
      <a href={href} style={aStyle}>{linkText}</a>
    </>
  )
}

function App() {
  return (
    <>
      <ul>
        <li>
          {React.Component}
        </li>
        <li>
          <MainLink></MainLink>
        </li>
      </ul>
    </>
  );
}

export default App;
